import { useAuth } from './user-auth/AuthContext';
import Logout from './user-auth/Logout'; 

export default function You () {
    const { isLoggedIn } = useAuth(); 

    return (
        <div>
        {isLoggedIn ? 
            <form onSubmit={Logout()}>
                <h2>Welcome to Accretion</h2>
                <button type="submit">
                    Log out 
                </button>
            </form> :
            <h2>
                Please login or sign up. 
            </h2>
        }
        </div>
    );
}
